 */

import React, { Component } from "react";
import TextField from '@material-ui/core/TextField';
import Autocomplete from '@material-ui/lab/Autocomplete';
import { airports } from "./airports";
import Grid from '@material-ui/core/Grid';
import { ScoreHeader, theme } from "../stylesUI";
import { QuizData } from '../Data/Fragen';


class Flight extends Component {

  render() {

    const { question, options, currentIndex, score } = this.props.state;
    return (
      <div>
        <ScoreHeader score={score} currentIndex={currentIndex} />
        <Grid container maxwidth="false" align="center" justifyContent="center" alignItems="center" spacing={10}>
        <h2>{question}</h2>

        <Autocomplete
          id="origin"
          options={airports}

          getOptionLabel={(option) => option.name}
          style={{ width: 300 }}
          renderInput={(params) => <TextField {...params} label="Origin" variant="outlined" />}
        />
        <br></br>
        <Autocomplete
          id="destination"
          options={airports}
          getOptionLabel={(option) => option.name}
          style={{ width: 300 }}
          renderInput={(params) => <TextField {...params} label="Destination" variant="outlined" />}
        />

        <br></br>
        <div className="OwnSubmit"
          >
          Submit</div>

          </Grid>
      </div >
    );
  }
}

export default Flight;
